const NavItems = () => {
  return(
    <div>
                <p className="py-3  pt-16 hover:900">text-gray-<a href="#">About</a></p>
          <p className="py-3 sm:py-4 hover:text-gray-900"><a href="#">Services</a></p>
          <p className="py-3 sm:py-4 hover:text-gray-900"><a href="#">Projects</a></p>
